pragma solidity ^0.8.18;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title ArkaERC20
 * @dev An ERC20 token for Arka
 */
contract ArkaERC20 is ERC20, Ownable {
    uint constant _initialSupply = 1000000000000000000;

    address public arkaMaster;

    // constructor(uint256 initialSupply) ERC20("Arka", "ARK") {
    constructor() ERC20("Arka", "ARK") {
        _mint(msg.sender, _initialSupply);
    }

    /**
     * @dev Setter to mean to the ERC20 which contract can mint tokens.
     *
     * @param _arkaMaster The address of the ArkaMaster contract.
     */
    function setArkaMaster(address _arkaMaster) external onlyOwner {
        arkaMaster = _arkaMaster;
    }

    function mintArka(address _account, uint _amount) external {
        require(msg.sender == arkaMaster, "Only ArkaMaster can mint");
        _mint(_account, _amount);
    }
}

contracts/ArkaMaster.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.18;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./ArkaERC20.sol";

/**
 * @title ArkaMaster
 * @author Po Mauguet
 * @notice This contract is used for orchestrating all features of ArkaSwapr.
 */
contract ArkaMaster is Ownable {
    ArkaERC20 public immutable arkaToken;
    // Mapping of user interactions over an identified resource. A user can only have 1 interaction per resource.
    mapping(uint => mapping(address => InteractType)) public interactions;

    // makes a sort of enum in solidity, named interactType, with values "like", "unlike", "love", "toxic"
    enum InteractType {
        unset,
        like,
        unlike,
        love,
        toxic
    }

    constructor(address _arkaToken) {
        arkaToken = ArkaERC20(_arkaToken);
    }

    // A user can interact one time with a resource (liking, unliking, etc.) and get rewarded by minting 1 token of arkaToken.
    function interact(
        address account,
        InteractType interaction,
        uint idResource
    ) public {
        require(
            interactions[idResource][account] == InteractType.unset,
            "You already interacted with this resource"
        );

        interactions[idResource][account] = interaction;

        // Rewards the user by minting 1 token of arkaToken to the user.
        arkaToken.mintArka(account, 1);
    }
}

